  Badge,
  Card,
  CardHeader,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  DropdownToggle,
  Media,
  Progress,
  Table,
  Container,
  Row,
  UncontrolledTooltip,
  CardBody,
  PaginationItem,
  PaginationLink,
  CardFooter,
  Pagination
} from "reactstrap";
import { BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';


import Header from "components/Headers/Header.jsx";

class Icons extends React.Component {
  state = {};
  render() {

    const data = [
        {
          name : 'brian',
          email: '@brian@gmail.com'
        },
        {
          name : 'wahyu',
          email: '@brian@gmail.com'
        },
        {
          name : 'andi',
          email: '@brian@gmail.com'
        },
        {
          name : 'dian',
          email: '@brian@gmail.com'
        },
      ]

    const options = {
      sizePerPage: 20,
      prePage: 'Previous',
      nextPage: 'Next',
      firstPage: 'First',
      lastPage: 'Last',
      hideSizePerPage: true,
    };
    return (
      <div>
        <Header />
        <Container className=" mt--7" fluid>
          <Row>
            <div className=" col">
              <Card className=" shadow">
                <CardHeader className=" bg-transparent">
                  <h3 className=" mb-0">List File</h3>
                </CardHeader>


              </Card>
            </div>
            </Row>
        </Container>
      </div>
    );
  }
}

export default Icons;
